  false,\n\t\"url\": null,\n\t\"notes\": \"This narrative report for Necedah NWR outlines
  Refuge accomplishments from May through July of 1939. The report begins by summarizing
  the weather conditions during this period. Wildlife- including migratory birds,
  upland game birds, furbearers, predators, rodents, mammals, and fish- is also covered.
  The Refuge development and maintenance section discusses physical developments and
  plantings. Resource management is outlined; topics include grazing and cooperative
  farming. The public relations section of the report describes recreational uses,
  Refuge visitors, fishing, and violations. Photographs are attached.\",\n\t\"owner_org\":
